CREATE TRIGGER categories_updated_at
AFTER UPDATE ON Categories
FOR EACH ROW
WHEN NEW.updated_at = OLD.updated_at OR NEW.updated_at IS NULL
BEGIN
  UPDATE Categories SET updated_at = datetime('now') WHERE category_id = NEW.category_id;
END;
CREATE VIEW V_TransactionsSigned AS
SELECT
  t.*,
  CASE
    WHEN UPPER(substr(t.transaction_type,1,1))='C' THEN abs(t.amount)
    WHEN UPPER(substr(t.transaction_type,1,1))='D' THEN -abs(t.amount)
    WHEN a.positive_is_credit=1 THEN t.amount
    ELSE -t.amount
  END AS effective_signed_amount
FROM Transactions t
JOIN Accounts a ON a.account_id=t.account_id;
CREATE VIEW V_TransactionsRecon AS
SELECT
  t.*,
  EXISTS(
    SELECT 1 
    FROM ReconciliationMatches m 
    WHERE m.transaction_id=t.transaction_id 
      AND m.active=1
  ) AS reconciled
FROM Transactions t;
COMMIT;
